const Example = () => {
    const clickHandler = (e) => {
        let [ val, setVal ] = useState();
        setVal(e.detail);
        console.log(e.detail )
      }
      return (
        <>
        {/* <p>ボタンAを{setVal}回押しました！</p> */}
        <button onClick = {clickHandler}>ボタンA</button>  
        </>
      )
};

export default Example;
